import axios from "axios";
function GetInItSateRedux() {
  axios.get("https://reqres.in/api/users?page=1").then((res1) => {
    const users1 = res1.data.data;
    return users1;
  });
}

// Tạo 1 công nhân reduce với tham số là action và state - state của redux ko phải react, hash code state bằng giá trị initState
const rootReducer = (state = GetInItSateRedux(), action) => {
  console.log(">>>Check state reducer", state);
  return state;
};
export default rootReducer;
